{"html":"<div class="rd3-page">
    <header class="header" style="background-image: url('/apps/gportal/img/bkg-datasets.jpg');">
        <div class="content">
            <h1>MOLGENIS-RD3</h1>
            <h2>The rare disease database</h2>
        </div>
        <div class="bg-filter" />
    </header>
    <div class="section bg-gray-050">
        <div class="section-content">
            <section aria-labelledby="section-intro-title">
                <h2 id="section-intro-title">Overview</h2>
                <p><strong>MOLGENIS-RD3</strong> is a model and database that provides the structure for capturing and managing research metadata. This includes characteristics about individuals and samples that were collected from them, as well as metadata on the experiments performed and the results that were produced (e.g., files variant interpretations, etc.).</p>
            </section>
        </div>
    </div>
    <div class="section bg-gray-000">
        <div class="section-content">
            <section aria-labelledby="section-available-tables-title">
                <h2 id="section-available-tables-title">Data Tables</h2>
                <p>Data is stored in many tables. An overview of the primary tables is provided below or you can <a href="../tables/#/">view all tables</a> to find other metadata of interest. All reference tables and ontologies are stored in the <a href="../../../CatalogueOntologies/tables/#/">ontologies database</a>.</p>
                <table class="table">
                    <thead>
                        <tr>
                            <th scope="col">Table</th>
                            <th scope="col">Description</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>
                                <a href="../tables/#/Individuals">
                                    Individuals
                                </a>
                            </td>
                            <td>
                                An overview of the individuals (participants, patients, etc.) that are the focus of study. This includes demographics and clinical characteristics, as well as information of the data providers and references to related records within the database.
                            </td>
                        </tr>
                        <tr>
                            <td>
                                <a href="../tables/#/Pedigree">Pedigrees</a>
                            </td>
                            <td>Overview of families (based on PED format). The definition of family members and the relationships between them are stored in <a href="../tables/#/PedigreeMembers">Pedigree Members</a>.</td>
                        </tr>
                        <tr>
                            <td>
                                <a href="../tables/#/ClinicalObservations">Clinical Observations</a>
                            </td>
                            <td>
                                Overview table containing information on clinical findings about an individual. Further details about clincial findings can be found in the <a href="../tables/#/DiseaseHistory">Disease History</a> and <a href="../tables/#/PhenotypeObservations">Phenotype Observations</a> tables.
                            </td>
                        </tr>
                        <tr>
                            <td><a href="../tables/#/Experiments">Experiments</a></td>
                            <td>Information about samples collected from an individuals and experiments that were performed.</td>
                        </tr>
                        <tr>
                            <td><a href="../tables/#/Files">Files</a></td>
                            <td>An aggregated view of files generated and where they are located. Specific locations and access information can be found in the <a href="../tables/#/FileLocations">File Locations</a> and <a href="../tables/#/FileStorageLocation">File Storage Locations</a> tables.</td>
                        </tr>
                        <tr>
                            <td>
                                <a href="../tables/#/VariantInterpretationAnalyses">
                                    Variant Interpretation Analyses
                                </a>
                            </td>
                            <td>An overview of the variant interpretations performed. Further information is stored in the <a href="../tables/#/VariantInterpretations">Variant interpretations</a> and <a href="../tables/#/InterpretationConsensus">Variant Interpretation Consensus</a>. Variants are defined in the <a href="../tables/#/GenomicVariants">Genomic Variants</a> table.</td>
                        </tr>
                    </tbody>
                </table>
            </section>
        </div>
    </div>
</div>","css":".rd3-page {
    font-size: 14pt;
    font-family: Helvetica, sans-serif; 
}

.rd3-page .header {
    filter: hue-rotate(40deg);
    position: relative;
    display: flex;
    justify-content: center;
    align-items: center;
    background-size: cover;
    background-position: 0 44%;
    height: 15em;
}

.rd3-page .header .content {
    width: 90%;
    margin: 0 auto;
    z-index: 1;
    max-width: 924px;
}

.rd3-page .header .content h1, 
.rd3-page .header .content h2 {
    margin: 0;
    line-height: 1.3;
    color: #f6f6f6;
}
.rd3-page .header .content h1 {
    font-size: 13pt;
    text-transform: uppercase;
    letter-spacing: 4px;
    font-weight: bold;
}

.rd3-page .header .content h2 {
    font-size: 32pt;
    font-weight: 200;
}

.rd3-page .header .bg-filter {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: hsla(0,0%,0%, 0.20);
}

.rd3-page .section {
    box-sizing: content-box;
}

.rd3-page .section .section-content {
    margin: 0 auto;
    width: 90%;
    max-width: 1024px;
    padding: 2em
}

.rd3-page .section .section-content h2 {
    font-weight: 600;
    line-height: 1.3;
    margin: 0;
    text-align: center;
}

.rd3-page .section .section-content p {
    line-height: 1.5;
}

.bg-gray-050 {
    background-color: #f6f6f6;
}

.bg-gray-000 {
    background-color: #ffffff;
}
